import React from 'react';
import style from '../style.module.css';

export default function Modal({ imgUrl, alt }) {
  return (
    <div className={style.Overlay}>
      <div className={style.Modal}>
        <img src={imgUrl} alt={alt} />
      </div>
    </div>
  );
}
